import React, { useEffect, useState } from 'react';
import { motion } from 'framer-motion';
import axios from 'axios';
import Nav from '../../components/Nav';

const Leaderboard = () => {
  const [players, setPlayers] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  const fetchLeaderboard = async () => {
    setIsLoading(true);
    try {
      const response = await axios.get('/api/leaderboard'); // Adjust URL as needed
      setPlayers(response.data);
    } catch (err) {
      console.error('Error fetching leaderboard:', err);
    }
    setIsLoading(false);
  };

  useEffect(() => {
    fetchLeaderboard();
  }, []);

  return (
    <div className="min-h-screen bg-dark text-white relative overflow-hidden flex flex-col">
      <div className="absolute inset-0 bg-gradient-radial from-primary/30 via-secondary/20 to-dark"></div>
      <Nav />

      <div className="relative z-10 container mx-auto px-4 py-8 flex flex-col gap-8">
        <div className="flex justify-between items-center">
          <h1 className="text-3xl font-bold">Leaderboard</h1>
          <button
            onClick={fetchLeaderboard}
            disabled={isLoading}
            className="flex items-center gap-2 px-4 py-2 bg-gray-700 hover:bg-gray-600 rounded-lg transition-colors"
          >
            <span className={`${isLoading ? 'opacity-50' : ''}`}>Refresh</span>
            {isLoading ? (
              <motion.div
                animate={{ rotate: 360 }}
                transition={{ repeat: Infinity, duration: 1, ease: 'linear' }}
                className="w-4 h-4 border-2 border-gray-400 border-t-transparent rounded-full"
              />
            ) : (
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                <path
                  fillRule="evenodd"
                  d="M4 2a1 1 0 011 1v2.101a7.002 7.002 0 0111.601 2.566 1 1 0 11-1.885.666A5.002 5.002 0 005.999 7H9a1 1 0 010 2H4a1 1 0 01-1-1V3a1 1 0 011-1zm.008 9.057a1 1 0 011.276.61A5.002 5.002 0 0014.001 13H11a1 1 0 110-2h5a1 1 0 011 1v5a1 1 0 11-2 0v-2.101a7.002 7.002 0 01-11.601-2.566 1 1 0 01.61-1.276z"
                  clipRule="evenodd"
                />
              </svg>
            )}
          </button>
        </div>

        {isLoading ? (
          <div className="flex justify-center items-center h-64">
            <motion.div
              animate={{ rotate: 360 }}
              transition={{ repeat: Infinity, duration: 1, ease: 'linear' }}
              className="w-12 h-12 border-4 border-primary border-t-transparent rounded-full"
            />
          </div>
        ) : (
          <>
            {/* Podium for top 3 */}
            <div className="grid grid-cols-3 gap-4 justify-center items-end">
              {players.slice(0, 3).map((player, index) => (
                <div
                  key={player._id}
                  className={`bg-gray-800/80 border border-gray-700 rounded-xl text-center p-4 shadow-lg ${
                    index === 0 ? 'scale-110 z-10' : 'scale-95'
                  }`}
                >
                  <div className="text-3xl mb-2">{index === 0 ? 'ðŸ¥‡' : index === 1 ? 'ðŸ¥ˆ' : 'ðŸ¥‰'}</div>
                  <div className="text-xl font-bold">@{player.username}</div>
                  <div className="text-gray-400">Rating: {player.rating}</div>
                </div>
              ))}
            </div>

            {/* Full leaderboard list */}
            <div className="mt-8 bg-gray-800/60 border border-gray-700 rounded-xl overflow-hidden shadow-lg">
              <div className="grid grid-cols-4 text-left font-semibold bg-gray-900/80 text-gray-300 px-6 py-3">
                <span>Rank</span>
                <span>Player</span>
                <span className="text-center">Rating</span>
                <span className="text-right">Wins</span>
              </div>
              <div className="divide-y divide-gray-700">
                {players.map((player, index) => (
                  <div
                    key={player._id}
                    className="grid grid-cols-4 px-6 py-4 hover:bg-gray-700/30 transition-colors"
                  >
                    <span className="text-gray-400">#{index + 1}</span>
                    <span className="font-medium">@{player.username}</span>
                    <span className="text-center">{player.rating}</span>
                    <span className="text-right">{player.wins}</span>
                  </div>
                ))}
              </div>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default Leaderboard;
